import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { Typography, Box } from "@material-ui/core";
import { useTheme } from "@material-ui/core/styles";
import { withStyles } from "@material-ui/core/styles";
import animalImg from "../img/animal.jpg";
import angryCatImg from "../img/angrycat.jpg";

const styles = (theme) => ({});

const useStyles = makeStyles((theme) => ({}));

const BlogEntry = (props) => {
  const { classes } = props;

  //   const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Navbar />
      <Box>
        <section id="bloglist" class="middle container">
          <h1>these are my blogs</h1>
          <h2 class="thinsubtitle">let's see how this goes</h2>

          <div class="bloglisting">
            <div class="blogimg">
              <img src={angryCatImg} />
            </div>
            <div class="blogcontent">
              <h3>
                <a href="blogEntry2.html">fan of cats</a>
              </h3>
              <p>i'm a fan of cats</p>
            </div>
          </div>
        </section>
      </Box>
      <Contact />
    </>
  );
};

export default withStyles(styles)(BlogEntry);
